webpackJsonp([0x772734f2f3ff],{363:function(A,a){A.exports={data:{site:{siteMetadata:{title:"MAJAC Blog",author:"majac6"}},markdownRemark:{id:"/Users/MAJAC/Documents/Project/majac/majac6.github.io/src/posts/2018-02-01-osc-tonight/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 27.790432801822323%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Open Source Consulting Tonight 2018"\n        title=""\n        src="/static/55f1d526785a01142b03b68411385558-55338.jpg"\n        srcset="/static/55f1d526785a01142b03b68411385558-a21e6.jpg 163w,\n/static/55f1d526785a01142b03b68411385558-4ac53.jpg 325w,\n/static/55f1d526785a01142b03b68411385558-55338.jpg 650w,\n/static/55f1d526785a01142b03b68411385558-80f1d.jpg 975w,\n/static/55f1d526785a01142b03b68411385558-7fc90.jpg 1300w,\n/static/55f1d526785a01142b03b68411385558-33712.jpg 1317w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  </p>\n<p>개인적으로 공식적인 행사에서 발표한 일이 처음이라 여러모로 부족한 점이 많았는데도, 많은 관심 가져주셔서 감사합니다. 발표때 사용한 프레젠테이션은 아래 링크를 참조해주세요.</p>\n<p><a href="http://slides.com/hungsunlim/deck/fullscreen">Javascript 로 만드는 멀티 플랫폼</a></p>\n<p>발표때 제가 준비한 자료는 크게 3가지 내용입니다.</p>\n<ul>\n<li>Gatsby.js 로 만드는 Static Web</li>\n<li>Angular, React, Vue 로 만드는 Web App</li>\n<li>ionic2, React Native, Framework7 으로 만드는 Mobile App</li>\n<li>Electron 으로 만드는 PC APP</li>\n</ul>\n<p>발표시간도 길지 않아, 아주 간단하게 자바스크립트로 다양한 플랫폼을 대응했던 제 경험을 바탕으로 이런저런 프레임워크를 소개하고 간단하게 보여드리는 정도로만 발표했었는데요. 다음엔 더 기회가 된다면 한가지 내용을 좀 더 많이 이야기할 수 있는 시간을 가질 수 있도록 할게요. 끝으로 이번 행사를 준비해주신 회사직원분들께 감사드리고, 추운 날씨에도 먼길 오셔서 행사 참가해주신 분들에게도 감사합니다.</p>',frontmatter:{title:"2018 OSC Tonight 행사 발표자료 공유",date:"2018년 2월 1일"}}},pathContext:{path:"/osc-tonight/"}}}});
